import React from 'react';
import { Card, CardContent } from './ui/card';

export default function VerseList({ verses }) {
  return (
    <div>
      <h2 className="text-lg font-semibold mb-4">Daftar Ayat</h2>
      <div className="space-y-3">
        {verses.map((verse) => (
          <Card key={verse.verse} className="bg-gray-100 dark:bg-gray-800">
            <CardContent>
              <p className="text-sm text-gray-500 dark:text-gray-400 mb-1">Ayat {verse.verse}</p>
              <p>{verse.text}</p>
            </CardContent>
          </Card>
        ))}
      </div>
    </div>
  );
}
